import React from "react";
//import PropTypes from "prop-types";

const ClearBoard = props => {
  return (
    <div>
      <p>Are you sure?</p>
      <button onClick={props.clear}>New Board</button>
      <Link to="/home/board" className="student__delete btn btn-primary">
        Cancel
      </Link>
    </div>
  );
};

export default ClearBoard;
